(184,1,"2019-02-06 19:29:17","2019-02-06 19:29:17","<h2>Usługi fotograficzne</h2>		\n		<p>Curabitur sodales ligula in libero dignissim lacinia nunc. Curabitur tortor. Pellentesque nibh aenean.<br />Quam in scelerisque sem at dolor maecenas mattis sed convallis.</p>		\n			<a href=\"#\" role=\"button\">\n						Skontaktuj się ze mną!\n					</a>\n			<figure><img width=\"150\" height=\"150\" src=\"http://fotomar.local/wp-content/uploads/2019/02/5033929273_563d8ff371_z-150x150.jpg\" alt=\"\" /></figure><h3>Ślub</h3><p>Zdjęcia prezentujące Wasze emocje: miłość, radość, wzruszenie, które towarzyszą Wam w tym wyjątkowym dniu. Fotografie, które zatrzymują te ważne chwile na zawsze....</p>		\n			<figure><img width=\"400\" height=\"400\" src=\"http://fotomar.local/wp-content/uploads/2019/02/ava2.png\" alt=\"\" srcset=\"http://fotomar.local/wp-content/uploads/2019/02/ava2.png 400w, http://fotomar.local/wp-content/uploads/2019/02/ava2-150x150.png 150w, http://fotomar.local/wp-content/uploads/2019/02/ava2-300x300.png 300w\" sizes=\"(max-width: 400px) 100vw, 400px\" /></figure><h3>Wesele</h3><p>Delikatne i subtelne zjęcia, które pozostaną pamiatką z Waszego wesela, uchwycą wspaniałą zabawę i Waszą radość.</p>		\n			<figure><img width=\"400\" height=\"400\" src=\"http://fotomar.local/wp-content/uploads/2019/02/ava4.png\" alt=\"\" srcset=\"http://fotomar.local/wp-content/uploads/2019/02/ava4.png 400w, http://fotomar.local/wp-content/uploads/2019/02/ava4-150x150.png 150w, http://fotomar.local/wp-content/uploads/2019/02/ava4-300x300.png 300w\" sizes=\"(max-width: 400px) 100vw, 400px\" /></figure><h3>Rodzinna</h3><p>Dla każdego z Was rodzina jest na pewno najważniejsza, dlatego warto uchwycić wspaniałe chwile spedzone razem na profesjonalnych zdjęciach, aby móc powrócić do nich po wielu latach.</p>		\n			<figure><img width=\"400\" height=\"400\" src=\"http://fotomar.local/wp-content/uploads/2019/02/ava1.png\" alt=\"\" srcset=\"http://fotomar.local/wp-content/uploads/2019/02/ava1.png 400